import '@ui5/webcomponents/dist/Tree.js';
import { ListMode } from '../../enums';
import { withWebComponent } from '../../internal/withWebComponent';
/**
 * The `Tree` component provides a tree structure for displaying data in a hierarchy.
 *
 * <ui5-link href="https://sap.github.io/ui5-webcomponents/playground/components/Tree" target="_blank">UI5 Web Components Playground</ui5-link>
 */
const Tree = withWebComponent('ui5-tree', ['accessibleName', 'accessibleNameRef', 'footerText', 'headerText', 'mode', 'noDataText'], [], ['header'], ['item-click', 'item-delete', 'item-mouseout', 'item-mouseover', 'item-toggle', 'selection-change']);
Tree.displayName = 'Tree';
Tree.defaultProps = {
    mode: ListMode.None
};
export { Tree };
